import React from 'react'
import { useEffect,useState } from 'react'


const Test = () => {

 const [data,setdata] = useState<any>()

      useEffect(() => {
    const value = '';
    // setdata("")
    setdata(`data:image/png;base64,${value}`);
  }, []);

  return (
    <div>
        
        <img src="data:image/jpeg;base64," alt="" />
        <img src={data} alt="" />
    </div>
  )
}

export default Test